export default (function(a,b,c,d,e,f,g,h,i,j,k){return {data:{"9EdY7FwJjp":{data:[{id:2745,attributes:{type:f,item_lang:{data:{id:3412,attributes:{title:"House of the Dragon",slug:"house-of-the-dragon"}}}}},{id:2747,attributes:{type:c,item_lang:{data:{id:3414,attributes:{title:"Bullet Train",slug:"bullet-train"}}}}},{id:2752,attributes:{type:c,item_lang:{data:{id:3419,attributes:{title:"White Noise",slug:"white-noise"}}}}},{id:2765,attributes:{type:c,item_lang:{data:{id:3432,attributes:{title:"Argylle",slug:"argylle"}}}}},{id:2772,attributes:{type:f,item_lang:{data:{id:3439,attributes:{title:"Super Pumped",slug:"super-pumped"}}}}}],meta:{pagination:{page:g,pageSize:25,pageCount:g,total:5}}},X1b5V8q4EO:{data:{id:487,attributes:{imdbId:"tt1614950",poster:"https:\u002F\u002Fm.media-amazon.com\u002Fimages\u002FM\u002FMV5BZTM4MmQyOTItOGZhYi00ZWMzLTgyMWMtNDIwZTM2NGJkYzAxXkEyXkFqcGdeQXVyNDgyODgxNjE@._V1_SX300.jpg",type:c,ratings:[{Source:"Internet Movie Database",Value:"5.8\u002F10"}],item_lang:{data:{id:1150,attributes:{title:h,plot:"Allie Pennington, the daughter of two Knights-of-the-Round-Table scholars, begins classes at Avalon High where, new to the area, she slowly discovers herself involved in the prophecy of King Arthur's reincarnation. Her being there is no accident. The Order of the Bear, an ancient secret society awaiting Arthur's return, may be at hand, and Allie's own parents, if not members of the Order, are at least Order wannabes. Allie becomes quickly linked to two classmates: Will, the school's revered pretty-boy quarterback (whose girlfriend is having relations on the side with his best friend, and whose dark, brooding step-brother lurks about threateningly), is the most obvious Arthur candidate. Miles, the observant and witty school geek, suffers psychic flashes that always prove true and may be the reincarnation of Merlin. As the Arthur prophecy seems to indeed be unfolding before her, Allie finds herself in the protectorate role, guarding Will against the forces of Mordred who're out to destroy Arthur at his every appearance down the centuries, whose destruction would plunge the world into another Dark Age.",slug:"avalon-high"}}},books:{data:[{id:3755,attributes:{title:h,description:"This New York Times bestselling hit from Meg Cabot mixes the wit of the Princess Diaries with a supernatural twist on the Arthurian legend. Ellie’s thrilled to meet Will, the star football player whose popularity at her new school is almost legendary. Yet as she gets to know Will better, Ellie starts to uncover some strange things about him. And the school. And even herself. Ellie doesn’t think much of déjà vu, but she just can’t shake the haunting feeling that, somehow, this has all happened before… A long-ago legend comes to new life in this tale of a love triangle, a medieval sword, and a totally awesome pool raft in this stand-alone novel from the New York Times bestselling author of The Princess Diaries.",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=cz1TAzWTsGQC&printsec=frontcover&img=1&zoom=5&edge=curl&source=gbs_api",authors:[b],firstBook:true,published:"2009-10-06",publisher:e,subtitle:a}},{id:3756,attributes:{title:"Avalon High: Coronation #2: Homecoming",description:"Meg Cabot's magical Arthurian epic continues . . . Manga style! Will's dangerous brother, Marco, has been released from the mental hospital, and it seems as if he's turned over a new leaf. But Ellie isn't sure she trusts him yet, especially when she keeps having creepy nightmares about him every night. Meanwhile, Mr. Morton is still convinced that Ellie's boyfriend, Will, is the reincarnation of King Arthur and that if Ellie doesn't help Will believe this, too, the world is going to end—this Friday. But all this won't stop Ellie from trying to pull off the big dinner party she's arranged to reunite Will with his parents . . . even though it might be a total disaster. When you and your friends are reliving Arthurian legend, you can never catch a break!",thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=vfIsgLq5oOIC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:"2008-06-24",publisher:e,subtitle:a}},{id:3757,attributes:{title:i,description:j,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=POmGDiULOzwC&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:k,publisher:e,subtitle:a}},{id:3758,attributes:{title:i,description:j,thumbnail:"https:\u002F\u002Fbooks.google.com\u002Fbooks\u002Fcontent?id=EJdJzgEACAAJ&printsec=frontcover&img=1&zoom=5&source=gbs_api",authors:[b],firstBook:d,published:k,publisher:"HarperCollins",subtitle:a}},{id:3759,attributes:{title:"Avalon High: Coronation Volume 1: The Merlin Prophecy",description:"Being a new student at Avalon High has been exciting for Ellie, to say the least--she's an honor student, a star on the track team, and, oh yeah, dating the super-hot class president, Will. Who also happens to be the alleged reincarnation of King Arthur. Ellie couldn't be happier to have Will in her life. but she's also worried that his estrangement from his parents is learning him apart. To make matters worse, Will's doubt that he really is King Arthur could prevent the Merlin Prophecy--an age of enlightenment--from occurring. Can Ellie convince Will to believe in something that even she isn't sure about? And more importantly, can she get him to give his parents another chance? With all the mythology and mysticism of Avalon High. Meg Cabot's very first manga is indeed a tale for the ages!",thumbnail:a,authors:[b],firstBook:d,published:"2007-06-12",publisher:"TokyoPop",subtitle:a}}]}}},meta:{}}},prerenderedAt:1681309155672}}("","Meg Cabot","movie",null,"Harper Collins","series",1,"Avalon High","Avalon High: Coronation #3: Hunter's Moon","The exciting conclusion to Meg Cabot's magical Arthurian manga! Ellie has only one day left to get her boyfriend Will to truly believe he's the reincarnation of King Arthur, or the world will plunge into eternal darkness. But Will refuses to believe her! Meanwhile, the upcoming Homecoming game and dance have everyone distracted, especially Ellie. Some people aren't too happy about her Homecoming Queen nomination and are determined to cause trouble. Ellie's got to save her reputation and the world before the new moon on the night of Homecoming brings them all to a dangerous crossroad. If Ellie can't convince Will of his destiny, the world may never recover. . . . This manga series of Arthurian legend and high school romance comes to a thrilling climax in this final volume. And just remember—anything can happen if you believe!","2009-09-01"))